import { Component } from "react";
export class Student extends Component{
    constructor(props){
        super(props);
        this.name = props.name;
        this.roll_no = props.roll_No;
    }
    render(){
        return (
            <div>
        <b>Name</b>{this.name}<br/>}
            </div>
        );
    }
}
